@pytest.mark.parametrize('file_name, first_field, expected_schema, expected_rows', test_corpus_params)
def test_corpus(tmp_path, file_name, first_field, expected_schema, expected_rows):
    args = parse_args([os.path.join(DB_FILES, "corpus", file_name), '-scf',
    '--export', 'csv', 'text', '--directory', str(tmp_path)])
    sqlite_files = get_sqlite_files(args.sqlite_path)

    # TODO: Refactor csv parsing to account for WITHOUT_ROWID cases (no schema info)
    # Some pages cannot be found, even with freelist carving enabled
    # TODO: Establish an acceptable ratio of pages found for similar tests
    if file_name == "03-01.db" or file_name == "09-01.db":
        pytest.skip("skipping tests on unimplemented functionality")

    with open(str(tmp_path / "log.txt"), 'w') as stdout:
        sys.stdout = stdout

        # Databases with no schema information are expected to fail; signature generation is impossible without more info
        if file_name == '08-01.db':
            with pytest.raises(NotImplementedError):
                main(args, sqlite_files[0], len(sqlite_files) > 1)
            
            return

        else:
            main(args, sqlite_files[0], len(sqlite_files) > 1)

    with open(str(tmp_path / (file_name + ".txt")), 'r') as stdout:
        schema = parse_schema(stdout.read())

    recovered_rows = []
    for file in tmp_path.iterdir():
        if file.suffix == '.csv' and 'autoindex' not in file.name:
            recovered_rows += parse_csv(str(file.resolve()), ['Carved', 'Added', 'Deleted', 'Updated'], first_field)

    assert expected_schema == schema
    assert not [row for row in recovered_rows if row not in expected_rows]
